import React, { Component } from 'react';


class DataGeneral extends Component {

  render() {

    console.log(this.props ? this.props:'');

    return (
        <div className="DataGeneral" >
            {this.props ? <h2>This component runs only if props data exist</h2>: ''}

            <p>{this.props.dataprops.home.name}</p> 
            <small>DataGeneral</small>
        </div>
    );
  }
}

export default DataGeneral;
